        ////////////////////////////////////////////////////////////////////////////////////////////////////
        /// <summary>   Gets the photo. </summary>
        ///
        /// <value> The photo. </value>
        ////////////////////////////////////////////////////////////////////////////////////////////////////

        public PersonPhoto Photo
        {
            get
            {
                if (PersonPhotos.Count > 0)
                    return PersonPhotos.OrderByDescending(o => o.InsertDate).FirstOrDefault();
                PersonPhotos.Add(new PersonPhoto());

                return PersonPhotos.FirstOrDefault();
            }
        }


